116	Dumbbell Bench Press	push	3	8,10,12	beginner	dumbbell, bench	Lie down on a flat bench with a dumbbell in each hand resting on top of your thighs. The palms of your hands will be facing each other. Then, using your thighs to help raise the dumbbells up, lift the dumbbells one at a time so that you can hold them in front of you at shoulder width. Once at shoulder width, rotate your wrists forward so that the palms of your hands are facing away from you. The dumbbells should be just to the sides of your chest, with your upper arm and forearm creating a 90 degree angle. Be sure to maintain full control of the dumbbells at all times. This will be your starting position. Then, as you breathe out, use your chest to push the dumbbells up. Lock your arms at the top of the lift and squeeze your chest, hold for a second and then begin coming down slowly. Tip: Ideally, lowering the weight should take about twice as long as raising it. Repeat the movement for the prescribed amount of repetitions of your training program.	chest	shoulders, triceps	https://github.com/wrkout/exercises.json/blob/master/exercises/Dumbbell_Bench_Press/images/0.jpg	https://github.com/wrkout/exercises.json/blob/master/exercises/Dumbbell_Bench_Press/images/1.jpg	\N	1
117	Lat Pulldown	pull	3	8,10,12	beginner	adjustable cable machine, lat pulldown bar	Sit down on a pull-down machine with a wide bar attached to the top pulley. Make sure that you adjust the knee pad of the machine to fit your height. These pads will prevent your body from being raised by the resistance attached to the bar. Grab the bar with the palms facing forward using the prescribed grip. Note on grips: For a wide grip, your hands need to be spaced out at a distance wider than shoulder width. For a medium grip, your hands need to be spaced out at a distance equal to your shoulder width and for a close grip at a distance smaller than your shoulder width. As you have both arms extended in front of you holding the bar at the chosen grip width, bring your torso back around 30 degrees or so while creating a curvature on your lower back and sticking your chest out. This is your starting position. As you breathe out, bring the bar down until it touches your upper chest by drawing the shoulders and the upper arms down and back. Tip: Concentrate on squeezing the back muscles once you reach the full contracted position. The upper torso should remain stationary and only the arms should move. The forearms should do no other work except for holding the bar; therefore do not try to pull down the bar using the forearms. After a second at the contracted position squeezing your shoulder blades together, slowly raise the bar back to the starting position when your arms are fully extended and the lats are fully stretched. Inhale during this portion of the movement. Repeat this motion for the prescribed amount of repetitions.	lats	biceps, middle back, shoulders	https://github.com/wrkout/exercises.json/blob/master/exercises/Wide-Grip_Lat_Pulldown/images/0.jpg	https://github.com/wrkout/exercises.json/blob/master/exercises/Wide-Grip_Lat_Pulldown/images/1.jpg	\N	1
118	Overhead Dumbbell Press	push	3	8,10,12	beginner	dumbbells	Stand with your feet shoulder-width apart and your knees slightly bent. Hold a pair of dumbbells just outside of your shoulders with your arms bent and palms facing each other. Press both dumbbells up until the weights are overhead and your arms are straight. Pause, then lower the dumbbells under control back to the starting position.	shoulders	abs, delts	https://www.muscleandfitness.com/wp-content/uploads/2017/04/overhead-press-compressed-800.jpg?w=300&quality=86&strip=all	https://www.muscleandfitness.com/wp-content/uploads/2017/04/overhead-press-extended-800.jpg?w=300&quality=86&strip=all	\N	1
119	Leg Press	push	3	8,10,12	beginner	machine	Using a leg press machine, sit down on the machine and place your legs on the platform directly in front of you at a medium (shoulder width) foot stance. (Note: For the purposes of this discussion we will use the medium stance described above which targets overall development; however you can choose any of the three stances described in the foot positioning section). Lower the safety bars holding the weighted platform in place and press the platform all the way up until your legs are fully extended in front of you. Tip: Make sure that you do not lock your knees. Your torso and the legs should make a perfect 90-degree angle. This will be your starting position. As you inhale, slowly lower the platform until your upper and lower legs make a 90-degree angle. Pushing mainly with the heels of your feet and using the quadriceps go back to the starting position as you exhale. Repeat for the recommended amount of repetitions and ensure to lock the safety pins properly once you are done. You do not want that platform falling on you fully loaded.	quadriceps	calves, glutes, hamstrings	https://github.com/wrkout/exercises.json/blob/master/exercises/Leg_Press/images/0.jpg	https://github.com/wrkout/exercises.json/blob/master/exercises/Leg_Press/images/1.jpg	\N	1
120	Lying Leg Curls	pull	3	8,10,12	beginner	machine	Adjust the machine lever to fit your height and lie face down on the leg curl machine with the pad of the lever on the back of your legs (just a few inches under the calves). Tip: Preferably use a leg curl machine that is angled as opposed to flat since an angled position is more favorable for hamstrings recruitment. Keeping the torso flat on the bench, ensure your legs are fully stretched and grab the side handles of the machine. Position your toes straight (or you can also use any of the other two stances described on the foot positioning section). This will be your starting position. As you exhale, curl your legs up as far as possible without lifting the upper legs from the pad. Once you hit the fully contracted position, hold it for a second. As you inhale, bring the legs back to the initial position. Repeat for the recommended amount of repetitions.	hamstrings		https://github.com/wrkout/exercises.json/blob/master/exercises/Lying_Leg_Curls/images/0.jpg	https://github.com/wrkout/exercises.json/blob/master/exercises/Lying_Leg_Curls/images/1.jpg	\N	1
121	Rope Pressdown	push	3	8,10,12	beginner	adjustable cable machine, rope attachment	Attach a rope attachment to a high pulley and grab with a neutral grip (palms facing each other). Standing upright with the torso straight and a very small inclination forward, bring the upper arms close to your body and perpendicular to the floor. The forearms should be pointing up towards the pulley as they hold the rope with the palms facing each other. This is your starting position. Using the triceps, bring the rope down as you bring each side of the rope to the side of your thighs. At the end of the movement the arms are fully extended and perpendicular to the floor. The upper arms should always remain stationary next to your torso and only the forearms should move. Exhale as you perform this movement. After holding for a second, at the contracted position, bring the rope slowly up to the starting point. Breathe in as you perform this step. Repeat for the recommended amount of repetitions.	triceps		https://github.com/wrkout/exercises.json/blob/master/exercises/Triceps_Pushdown_-_Rope_Attachment/images/0.jpg	https://github.com/wrkout/exercises.json/blob/master/exercises/Triceps_Pushdown_-_Rope_Attachment/images/1.jpg	\N	1
