4	Weeks 1-4	During the first month of strength training, workouts should include 1 to 3 sets of each of the 10 to 12 different exercises with a one-minute rest between exercises. Perform the exercises using a moderate weight. Beginners with a very low level of fitness may need to get in shape before participating in a strength training program that maximizes gains in muscular fitness. In other words, if you have never strength trained before, additional time for muscular adaptation is recommended. For example, instead of performing 8 to 12 exercises with a moderate weight, try performing 4 to 6 different exercises with a light weight, and perhaps perform only 1 set per exercise. This will give you an opportunity to gain confidence in your ability to strength train. A major goal of this training phase is to learn proper form and technique on a variety of upper- and lower-body exercises while practicing training fundamentals (e.g., proper technique, controlled movements, maintaining a normal breathing pattern). Thus, an initial load of 60 to 65 percent of 1RM will allow you to be in the zone of 10 to 12 repetitions on a variety of upper- and lower-body exercises that target all the major muscle groups. Of course, you can use lighter loads when learning a new exercise or attempting to correct a flaw in exercise technique. At least one exercise for all the major muscle groups should be performed.	1
5	Weeks 5-8	During weeks 5 through 8, the workout should become more challenging as strength and coordination improve. By varying the program variables, you start to accomplish specific goals in health and fitness, and you prevent the boredom and training plateaus that eventually lead to a lack of adherence to the program or to dropping out of the program entirely. This is a good time to think about the physical and psychosocial benefits of strength training. Although positive changes in physical abilities certainly are important, so too are the qualitative changes associated with a more active lifestyle. During this period, increase the training volume by performing 3 to 4 sets of 10 exercises at a training intensity of about 75 percent of 1RM (8-10 repetitions). Rest for about one to two minutes between sets. As additional sets are performed in the training program, continued effort will determine training outcomes. Thus, you should expect and welcome the feelings of exercise exertion. A major goal of this conditioning phase is to be confident in your exercises while maximizing training adaptations.	1
6	Weeks 9-12	After the first eight weeks of strength training, improvements in muscular fitness will occur at a slower rate. Beginners who started strength training with great enthusiasm may become disappointed when gains in muscle strength become less dramatic during the third month of training. This is where you need to understand that a strength training workout that was effective during the first few weeks of training may not be effective in the long term. To make continual gains in muscular fitness and to achieve specific health and fitness goals, higher intensities and a more challenging training program are required (i.e., the principle of progressive overload). This is particularly important for people who want to maximize gains in muscle strength or muscle size. During this phase, perform 3 to 4 sets of 8 exercises at a training intensity of 75 to 80 percent of 1RM (6-8 repetitions). Rest about two to three minutes between sets. Although endless combinations of program variables can be used, continued improvement requires that you increase the training weight and reduce the repetitions to the lower end of the training zone once you have performed the desired number of repetitions on the last set. As a general recommendation, you should perform more sets on exercises for large muscle groups than on exercises for smaller muscle groups. However, research has shown that beginners do not experience greater strength gains when performing more than 4 sets per exercise. Therefore, any exercise should probably not be performed for longer than 4 sets.	1
